INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (1, '610000', 'Ley N° 453: Los medios de comunicación deben promover el respeto de los derechos de los usuarios y consumidores.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (2, '610000', 'Ley N° 453: Los medios de comunicación deben evitar contenidos inapropiados que vulneren la protección de niñas, niños y adolescentes.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (3, '001220', 'Ley N° 453: Puedes acceder a la reclamación cuando tus derechos han sido vulnerados.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (4, '001220', 'Ley N° 453: El proveedor debe brindar atención sin discriminación, con respeto, calidez y cordialidad a los usuarios y consumidores.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (5, '610000', 'Ley N° 453: Tienes derecho a un trato equitativo sin discriminación en la oferta de servicios.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (6, '001220', 'Ley N° 453: El proveedor de productos debe habilitar medios e instrumentos para efectuar consultas y reclamaciones.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (7, '465210', 'Ley N° 453: Está prohibido importar, distribuir o comercializar productos expirados o prontos a expirar.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (8, '001220', 'Ley N° 453: Los contratos de adhesión deben redactarse en términos claros, comprensibles, legibles y deben informar todas las facilidades y limitaciones.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (9, '001220', 'Ley N° 453: Si se te ha vulnerado algún derecho puedes exigir la reposición o restauración.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (10, '610000', 'Ley N° 453: Las publicaciones, mensajes e imágenes no deben promover la sumisión o explotación de las mujeres.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (11, '610000', 'Ley N° 453: Las publicaciones, mensajes e imágenes no deben deshonrar y atentar contra la dignidad e imagen de la mujer');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (12, '465210', 'Ley N° 453: Los alimentos declarados de primera necesidad deben ser suministrados de manera adecuada, oportuna, continua y a precio justo.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (13, '001220', 'Ley N° 453: Se debe promover el consumo solidario, justo, en armonía con la Madre Tierra y precautelando el hábitat, en el marco del Vivir Bien.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (14, '001220', 'Ley N° 453: Tienes derecho a recibir información sobre las características y contenidos de los servicios que utilices.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (15, '001220', 'Ley N° 453: El proveedor deberá dar cumplimiento a las condiciones ofertadas.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (16, '465210', 'Ley N° 453: Tienes derecho a recibir información sobre las características y contenidos de los productos que consumes.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (17, '465210', 'Ley N° 453: Tienes derecho a un trato equitativo sin discriminación en la oferta de productos.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (18, '465210', 'Ley N° 453: Está prohibido importar, distribuir o comercializar productos prohibidos o retirados en el país de origen por atentar a la integridad física y a la salud.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (19, '001220', 'Ley N° 453: Están prohibidas las prácticas comerciales abusivas, tienes derecho a denunciarlas.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (20, '465210', 'Ley N° 453: El proveedor deberá entregar el producto en las modalidades y términos ofertados o convenidos.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (21, '465210', 'Ley N° 453: En caso de incumplimiento a lo ofertado o convenido, el proveedor debe reparar o sustituir el producto..');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (22, '610000', 'Ley N° 453: Los medios de comunicación deben difundir mensajes o programas de educación de consumo responsable y sustentable.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (23, '465210', 'Ley N° 453: Los servicios deben suministrarse en condiciones de inocuidad, calidad y seguridad.');
INSERT INTO comercial.catalogo_leyendas_factura (id, ley_cod_act, ley_des_ley) VALUES (24, '610000', 'Ley N° 453: Los servicios deben suministrarse en condiciones de inocuidad, calidad y seguridad.');
